print(1 > 2) #Me muestra mediante un boolean si la expresión de comparación lógica "mayor que" es Verdadera o Falsa, en este caso es False
print(1 < 2) #Me muestra mediante un boolean si la expresión de comparación lógica "menor que" es Verdadera o Falsa, en este caso es True
print(1 <= 2) #Me muestra mediante un boolean si la expresión de comparación lógica "menor o igual que" es Verdadera o Falsa, en este caso es True, ya que sólo con cumplir con uno de los dos comparadores lógicos es verdadera
print(1 >= 2) #Me muestra mediante un boolean si la expresión de comparación lógica "mayor o igual que" es Verdadera o Falsa, en este caso es False, ya que sólo con NO cumplir con uno de los dos comparadores lógicos es falsa
print(2 >= 2) #Me muestra mediante un boolean si la expresión de comparación lógica "mayor o igual que" es Verdadera o Falsa, en este caso es True, ya que sólo con cumplir con uno de los dos comparadores lógicos es verdadera
print(2 <= 2) #Me muestra mediante un boolean si la expresión de comparación lógica "menor o igual que" es Verdadera o Falsa, en este caso es True, ya que sólo con cumplir con uno de los dos comparadores lógicos es verdadera
print(2 == 2) #Me muestra mediante un boolean si la expresión de comparación lógica "igual o igual" es Verdadera o Falsa, en este caso es True
print(2 == 3) #Me muestra mediante un boolean si la expresión de comparación lógica "igual o igual" es Verdadera o Falsa, en este caso es False
print(2 == '2') #Me muestra mediante un boolean si la expresión de comparación lógica "igual o igual" es Verdarera o Falsa, en este caso es False, ya que está comparando un int con un String
print(2 != '2') #Me muestra mediante un boolean si la expresión de comparación lógica "diferente que" es Verdarera o Falsa, en este caso es True, ya que está comparando un int con un String
print(2 != 2) #Me muestra mediante un boolean si la expresión de comparación lógica "diferente que" es Verdarera o Falsa, en este caso es False
